// Converte o texto em Markdown que chega em $json.output para HTML b√°sico
// Sa√≠da: { html: "<!doctype html>... </html>" }

const md = ($json.output ?? '').toString();

// 1) Escapa HTML bruto para evitar quebras
function escapeHtml(s) {
  return s.replace(/&/g, '&amp;')
          .replace(/</g, '&lt;')
          .replace(/>/g, '&gt;');
}
let html = escapeHtml(md);

// 2) T√≠tulos (#, ##, ### ...)
html = html
  .replace(/^###### (.*)$/gm, '<h6>$1</h6>')
  .replace(/^##### (.*)$/gm, '<h5>$1</h5>')
  .replace(/^#### (.*)$/gm,  '<h4>$1</h4>')
  .replace(/^### (.*)$/gm,   '<h3>$1</h3>')
  .replace(/^## (.*)$/gm,    '<h2>$1</h2>')
  .replace(/^# (.*)$/gm,     '<h1>$1</h1>');

// 3) Negrito e it√°lico (**texto**, *texto*)
html = html
  .replace(/\*\*(.+?)\*\*/g, '<strong>$1</strong>')
  // it√°lico com cuidado para n√£o pegar * em listas
  .replace(/(^|[\s(])\*(?!\s)(.+?)(?<!\s)\*(?=[\s).,;:!?]|$)/g, '$1<em>$2</em>');

// 4) Constr√≥i listas e par√°grafos
const lines = html.split(/\r?\n/);
let out = [];
let inUl = false, inOl = false;

function closeLists() {
  if (inUl) { out.push('</ul>'); inUl = false; }
  if (inOl) { out.push('</ol>'); inOl = false; }
}

for (const line of lines) {
  let m;
  if ((m = line.match(/^\s*[-‚Ä¢*]\s+(.*)$/))) {
    if (inOl) { out.push('</ol>'); inOl = false; }
    if (!inUl) { out.push('<ul>'); inUl = true; }
    out.push(`<li>${m[1]}</li>`);
  } else if ((m = line.match(/^\s*\d+\.\s+(.*)$/))) {
    if (inUl) { out.push('</ul>'); inUl = false; }
    if (!inOl) { out.push('<ol>'); inOl = true; }
    out.push(`<li>${m[1]}</li>`);
  } else {
    closeLists();
    if (line.trim() === '') {
      out.push('<br/>');
    } else {
      out.push(`<p>${line}</p>`);
    }
  }
}
closeLists();

const body = out.join('\n');

// 5) HTML final com estilo simples (bom para convers√£o a DOCX)
const fullHtml = `<!doctype html>
<html lang="pt-BR">
<head>
  <meta charset="utf-8">
  <style>
    body{font-family: Arial, Helvetica, sans-serif; line-height:1.38; color:#111; margin:24px;}
    h1{font-size:20pt;margin:0 0 8px} h2{font-size:16pt;margin:16px 0 6px} h3{font-size:13pt;margin:14px 0 6px}
    h4,h5,h6{margin:12px 0 6px}
    p{margin:6px 0}
    ul,ol{margin:6px 0 12px 22px} li{margin:2px 0}
    strong{font-weight:700} em{font-style:italic}
    table{border-collapse:collapse;margin:8px 0;width:100%}
    th,td{border:1px solid #ccc;padding:6px;vertical-align:top}
  </style>
</head>
<body>
${body}
</body>
</html>`;

return [{ json: { html: fullHtml } }];
